import React , { useState } from 'react';

function App(){
  
  const [incre , setincre] = useState(0);

  function IncrementF(){
    setincre(incre + 1)
  }

  function DecrementF(){
    setincre(incre + 1)
  }

  return(
    <React.Fragment>
      <h1>{incre}</h1>
      <button onClick={IncrementF}>Increment</button>
      <button onClick={DecrementF}>Decrement</button>
    </React.Fragment>
    
  )
}

export default App;
